      {
        document.getElementById('status').style.display = 'none';
        document.getElementById('content').style.display = '';
      }
      
      function Loading()
      {
        document.getElementById('content').style.display = 'none';
        document.getElementById('status').style.display = '';
      }
      
      function setHeight()
      {
        if (self.innerHeight) //All except Explorer.
        {
          document.getElementById('content').style.height = self.innerHeight;
        }
        else if (document.documentElement && document.documentElement.clientHeight) //Strict Mode IE.
        {
          document.getElementById('content').style.height = document.documentElement.clientHeight - 3;
        }
        else if (document.body) //Other Explorers.
        {
          document.getElementById('content').style.height = document.body.clientHeight;
        }
      }
      
      function ReturnToLobby()
      {
        window.close();
      }
    </script>
